import resumeSectionRight from './resumeSectionRight.js';

function Resume() {
    var props = {}
    return (
        <div style={resumeCSS} id="resume">
        {Education()}
        </div>
    )
}

function Education() {
    var props = {
        title: "University of California San Diego",
        subtitle: "B.S. in Computer Science",
        date: "September 2016 - June 2020",
        body: "Describe your experience at school, what you learned, what useful skills you ahve acquired etc."
    }
    return (
        <div style={resumeSectionCSS}>
            <div style={{
                        width: "25%",
                        textTransform: "uppercase",
                        letterSpacing: "1px",
                        float: "left"
                        }}> 
                <div style={{position: 
                            "relative", 
                            padding: "0 20px"
                            }}>
                    <h1>
                        <span style={{
                                paddingBottom: "6px",
                                borderBottom: "3px solid #11ABB0",
                                font: "bold 18px/24px opensans-bold, sans-serif"
                                }}>
                            Education
                        </span>
                    </h1>
                </div>
            </div>
            <div style={{
                width: "75%",
                float: "right"
            }}>
                <div style={{position: 
                            "relative", 
                            padding: "0 20px", 
                            float: "left"}}>
                    <div style={{width: "auto", maxWidth: "none", margin: "0 20px"}}>
                        <h2 style={{font: `bold 25px/30px 'opensans-bold', sans-serif`}}>
                            University of California San Diego
                        </h2>
                        <p style={info}>
                            B.S. in Computer Science
                            <span style={{margin: "0 5px"}}> • </span>
                            <em style={{font: `15px/24px 'opensans-regular', sans-serif`
                                        }}>
                                September 2016 - June 2020
                            </em>
                        </p> 
                        <p style={bodyCSS}>
                            Describe your experience at school, what you learned, what 
                            useful skills you have acquired etc.
                        </p>
                    </div>
                </div>
            </div>
        </div>
    )
}

const resumeSectionCSS = {
    marginBottom: "48px",
    marginLeft: "48px",
    paddingBottom: "24px",
    borderBottom: "1px solid #E8E8E8",
    width: "96%",
    //maxWidth: "1020px",
    display: "inline-flex"
}

const resumeCSS = {
    background: "#fff",
    paddingTop: "90px",
    paddingBottom: "72px",
    overflow: "hidden"
}

const info = {
    font: `16px/24px 'LibreBaskerville Italic', sans-serif`,
    color: "#6E7881",
    marginBottom: "18px",
    marginTop: "9px"
}

const bodyCSS = {
    font: "15px/30px 'opensans-regular', sans-serif",
    color: "#838C95"
}


export default Resume;
